import './style-right-section-editor.css';

function RightSectionEditor() {
    return (
        <div id='row-2'>
            <select id="select-label-backgraund">
                <option value=""></option>
                <option value="white">Белая бирка</option>
                <option value="violet">Фиолетовая бирка</option>
            </select>
            <div id='row-child'>
                {/* <DivLabel /> */}
                <div id="text-printer">
                    <p id="text-printer-1">Отправить шаблон на ручную печать</p>
                    <p id="text-printer-2">Отправить шаблон на авто печать</p>
                </div>
                <div id="button-printer">
                    <button id="chyase-label">Отправить шаблон</button>
                    <button id="sending">Отправить шаблон</button>
                </div>
            </div>
        </div>
    );
};

export default RightSectionEditor;
